import uuid
import datetime

class Submission:
    def __init__(self, data):
        self.submission_id = str(uuid.uuid4())
        self.data = data
        self.status = 'Pending'
        self.created_at = datetime.datetime.now()
        self.updated_at = self.created_at
        self.validation_errors = []

    def validate(self):
        if not self.data.get('name'):
            self.validation_errors.append("Name is required.")
        if not isinstance(self.data.get('age'), int) or self.data['age'] < 0:
            self.validation_errors.append("Age must be a non-negative integer.")
        if not self.data.get('email'):
            self.validation_errors.append("Email is required.")
        return not self.validation_errors

    def update_status(self, new_status):
        if new_status in ['Pending', 'Completed', 'Failed']:
            self.status = new_status
            self.updated_at = datetime.datetime.now()
            return True
        return False

class SubmissionManager:
    def __init__(self):
        self.submissions = {}

    def submit_data(self, data):
        submission = Submission(data)
        if submission.validate():
            self.submissions[submission.submission_id] = submission
            return submission.submission_id
        else:
            return submission.validation_errors

    def get_status(self, submission_id):
        submission = self.submissions.get(submission_id)
        if submission:
            return submission.status
        return 'Submission ID not found.'

    def log_submission_event(self, submission_id, event_description):
        submission = self.submissions.get(submission_id)
        if submission:
            print(f"Event Log for {submission_id}: {event_description} at {datetime.datetime.now()}")

    def get_submission_history(self):
        return {submission_id: submission.status for submission_id, submission in self.submissions.items()}

    def update_submission_status(self, submission_id, new_status):
        submission = self.submissions.get(submission_id)
        if submission:
            if submission.update_status(new_status):
                self.log_submission_event(submission_id, f"Status updated to {new_status}")
                return True
        return False

# Example usage
manager = SubmissionManager()

# Submitting data
submission_id = manager.submit_data({
    'name': 'John Doe',
    'age': 30,
    'email': 'john.doe@example.com'
})
print(f"Submission ID: {submission_id}")

# Checking status
status = manager.get_status(submission_id)
print(f"Submission Status: {status}")

# Update status
manager.update_submission_status(submission_id, 'Completed')
print(f"Updated Status: {manager.get_status(submission_id)}")

# View submission history
print("Submission History:", manager.get_submission_history())

# Submitting invalid data
errors = manager.submit_data({
    'name': '',
    'age': -5,
    'email': ''
})
print("Validation Errors:", errors)
